import React from "react";
import "./Button.css";
import styled from "styled-components";

const Button = (props) => {
  return (
    <button onClick={props.onClick} style={{ marginRight: props.marginRight }}>
      {props.children}
    </button>
  );
};

export default Button;

const ButtonStyly = styled.div`
  padding: 18px;
  font-weight: 600;
  color: aliceblue;
  background-color: #4a026b;
  border: none;
  border-radius: 10px;
`;
